import React from 'react'
import Animal from './Animal'
import tiger from './img/tiger.png'
import ziege from './img/ziege-1.png'
const animals = [
  { title: 'Tiger', picture: tiger },
  { title: 'Ziege', picture: ziege }
]

export default function App() {
  return animals.map(animal => (
    <Animal key={animal.title} title={animal.title} picture={animal.picture} />
  ))
}
